import React from "react";
import Card from "./Card";



const Cardlist = (props) => {
    return (
        <div>
        <Card id={props.robots[0].id} name={props.robots[0].name} username={props.robots.at(0).username} />
        <Card id={props.robots[1].id} name={props.robots[1].name} username={props.robots.at(1).username} />
        <Card id={props.robots[2].id} name={props.robots[2].name} username={props.robots.at(2).username} />
        </div>
    )
}

export default Cardlist;
